Я предполагаю, что вы хотите узнать, как настроить OpenSSL для работы с SSI (Secure Sockets Layer) стандартом SSL/TLS в C++.

Для этого можно использовать библиотеку OpenSSL, которая предоставляет API для работы с SSL/TLS в C++.

Ниже приведен пример кода, который демонстрирует, как использовать OpenSSL для создания SSL/TLS соединения:

```cpp
#include <iostream>
#include <openssl/ssl.h>
#include <openssl/err.h>

int main() {
    SSL_library_init();
    const SSL_METHOD *method = SSLv23_server_method();
    SSL_CTX *ctx = SSL_CTX_new(method);

    if (!ctx) {
        std::cerr << "Unable to create SSL context\n";
        ERR_print_errors_fp(stderr);
        exit(EXIT_FAILURE);
    }

    // Настройка SSL контекста
    SSL_CTX_set_ecdh_auto(ctx, 1);
    SSL_CTX_set_options(ctx, SSL_OP_NO_SSLv2 | SSL_OP_NO_SSLv3 | SSL_OP_NO_TLSv1 | SSL_OP_NO_TLSv1_1 | SSL_OP_NO_COMPRESSION);

    // Создание SSL соединения
    SSL *ssl = SSL_new(ctx);
    BIO *bio = BIO_new_accept_acceptor(80);
    BIO *sbio = BIO_accept(bio);

    if (!sbio) {
        std::cerr << "Unable to accept connection\n";
        ERR_print_errors_fp(stderr);
        SSL_CTX_free(ctx);
        exit(EXIT_FAILURE);
    }

    SSL_set_bio(ssl, sbio, sbio);

    // Установка SSL соединения
    if (SSL_connect(ssl) <= 0) {
        std::cerr << "Unable to connect\n";
        ERR_print_errors_fp(stderr);
        SSL_shutdown(ssl);
        SSL_free(ssl);
        BIO_free_all(bio);
        SSL_CTX_free(ctx);
        exit(EXIT_FAILURE);
    }

    // Здесь можно добавить код для обработки SSL соединения

    SSL_shutdown(ssl);
    SSL_free(ssl);
    BIO_free_all(bio);
    SSL_CTX_free(ctx);

    return 0;
}
```

Этот код создает SSL контекст, настраивает его для использования SSL/TLS версий 1.2 и выше, а также отключает сжатие. Затем он создает SSL соединение с клиентом, используя BIO (бинарный ввод-вывод) объект, который создается с помощью BIO_new_accept_acceptor. Затем он устанавливает SSL соединение и проверяет, что оно установлено успешно.

