El bucle `for` en programación es una estructura de control que se repite un conjunto de instrucciones un número específico de veces o hasta que una condición se cumpla. En la forma sentencia, el bucle `for` se utiliza de la siguiente manera:

```
for (inicialización; condición; actualización) {
    // Código a ejecutar en cada iteración
}
```

- `inicialización`: Se ejecuta una sola vez al inicio del bucle, para inicializar las variables de control.
- `condición`: Se evalúa antes de cada iteración del bucle. Si la condición es verdadera, se ejecuta el código dentro del bucle. Si la condición es falsa, el bucle termina.
- `actualización`: Se ejecuta al final de cada iteración del bucle, para actualizar las variables de control.

Por ejemplo, el siguiente bucle `for` imprime los números del 1 al 10:

```
for (let i = 1; i <= 10; i++) {
    console.log(i);
}
```

En este ejemplo, `i` es la variable de control, se inicializa en 1, la condición es que `i` sea menor o igual a 10, y se actualiza en cada iteración.

