    System.out.println("Hola, mundo!");
}
```

En este ejemplo, el bucle `for` se repite 10 veces y imprime "Hola, mundo!" en la consola. La estructura del bucle `for` es la siguiente:

```
for (inicialización; condición; incremento) {
    // Código a repetir
}
```

- `inicialización`: se ejecuta una sola vez al inicio del bucle y se utiliza para inicializar la variable de control.
- `condición`: se evalúa antes de cada iteración del bucle. Si la condición es verdadera, se repite el bucle; de lo contrario, se termina.
- `incremento`: se ejecuta al final de cada iteración del bucle y se utiliza para actualizar la variable de control.

También puedes utilizar un bucle `for-each` en Java para iterar sobre un arreglo o una colección:

```java
int[] numeros = {1, 2, 3, 4, 5};
for (int numero : numeros) {
    System.out.println(numero);
}
```

En este ejemplo, el bucle `for-each` itera sobre el arreglo `numeros` y asigna cada elemento a la variable `numero`.
